function parsePaperFilenames(s) {
    return Strings.lines(s).collect(function(line) {
        var m = new RegExp("([A-Za-z]+) ([0-9][0-9][0-9][0-9]) ([A-Za-z]+)","g")
            .exec(line.replace(/_/g," "));
        if (!m) return [line]
        var authors = m[1];
        var year = m[2];
        var title = m[3];
        authors  = authors.replace(/([A-Z][a-z]+)/g, '$1 ').split(" ")
        var keyletters = title.replace(/([A-Z][a-z]*)/g, '$1 ').split(" ")
            .reject(function(ea) { 
                return ["A", "On", "For", "Of", "The", "To"].include(ea)})
            .slice(0,3)
            .collect(function(ea) {
                return ea[0]
            }).join("")
        return  [authors[0] + year + keyletters,  line]
    })
}

